	this.timeline.addTween(cjs.Tween.get(this.throtle_btn).wait(1));

	// Ready
	this.tablet_mc = new lib.RSG();
	this.tablet_mc.name = "tablet_mc";
	this.tablet_mc.setTransform(525.25,261.4,1,1,0,0,0,2.2,0.4);

	this.timeline.addTween(cjs.Tween.get(this.tablet_mc).wait(1));

	// Frontground
	this.instance = new lib.GROUND();
